INSERT INTO visitas VALUES('2530', '14', '703', '5', '2008-03-06', 'Visit? varios restaurantes en la zona de CA?ITAS: LOS MELLIZOS: Quieren muestras con lista. LAS CHOLAS: Queren lista de precios. LAS CORTADERAS: Llamar? el comprador. ROMARIO: Hacen compra central. *MORELIA: Quiere muestra de Ma y lista de precios. PIEGARI: Hacen compra central. EL BAGUAL: Quiere lista de precios via e-mail. CAMPOBRAVO: Hacen compra central. PLAZA MAYOR: Hacen compra central. MAMA EUROPA: Llamar?n... Y OTROS... Sensaci?n general: van a ver, por el momento no andan con planes de ampliar la carta de vinos, venga en otro momento. Salvo (*) pareci? genuinamente interesado como vino de las casa y la saxofonista. ');
INSERT INTO visitas VALUES('2542', '14', '750', '5', '2008-03-11', 'Hablamos y le dej? muestras: 1xMa, 1xCS, 1xCh, 1xMaRo (nuevo), 1xSaxo. Lo van a probar y me llama en una o dos semanas. Su propuesta es la de estar en una promoci?n mensual \"compra una botella y te regalamos una\" para los clientes directamante. Ser?a para el mes de Mayo. Hablamos de 250 cajas compradas y 250 de regalo para entregar a los clientes. 500 en total para los 4 Siga la Vaca y una franquicia. Mueve mensualmente un total de 100.000 personas! ');
INSERT INTO visitas VALUES('2543', '12', '233', '5', '2008-03-11', 'estuve en Jumbo Unicenter, recorri las gondolas, el vino estaba, con precio actualizado de $13,50');
INSERT INTO visitas VALUES('2544', '12', '233', '5', '2008-03-11', 'estuve en Jumbo Palermo ahi me encontre con Nidia, hna de Enzo, ella es la encargada de esa Boca y de Unicenter. Los vinos estaban con precio actualizado, le entregue carteles para colgar en las botellas para las dos bocas, le comente las ideas de este a?o y las nuevas incorporaciones, nos volvemos a juntar despues de semana santa para hacer otra recorrida. ');
INSERT INTO visitas VALUES('2546', '12', '515', '5', '2008-03-12', 'estuve en la reunion de logistica, donde contaron las prox aperturas, llegaran a 21. Ademas comentaron q hay posibilidad de aumentar el dto de logistica en dos puntos pero se avisara con anticipacion y se hablara con cada proveedor puntualmente a fin de llegar a un acuerdo ');
INSERT INTO visitas VALUES('2547', '12', '515', '5', '2008-03-11', 'visite Constituyentes corrobore q esten los productos, estan en buen estado y bien ubicados al precio de $13.');
INSERT INTO visitas VALUES('2550', '12', '752', '5', '2008-03-12', 'Me junte nuevamente con ?l, la primera entrevista fue el a?o pasado. Esta con ganas de mover el vino, se llevo un catalogo, precios, carteles y unas muestras para arrancar');
INSERT INTO visitas VALUES('2551', '12', '230', '5', '2008-03-12', 'le deje a Luli, para que prueben con la mama, que es gran tomadora,para el casamiento a ver si le gusta, hay posibilidad de darles el premiun.');
INSERT INTO visitas VALUES('2555', '12', '233', '5', '2008-03-13', 'estuve en Jumbo almagro con enzo, recorrimos la gondola, los vinos tienen mejor posicion y dos frentes, les pusimos collarines.Arreglamos para la proxima otra visita');
INSERT INTO visitas VALUES('2563', '12', '754', '5', '2008-03-18', 'Estuve con Daniel, el encargado, estaba interesado asi que dijo que la semana que viene probamos haber que opina la gente. Muy buena predisposicion.');
INSERT INTO visitas VALUES('2567', '12', '755', '5', '2008-03-18', 'tienen la concesion del club Los Cedros, organizan casamientos y eventos, me paso los datos de la mujer que es la encargada de compras para arreglar una entrevista');
INSERT INTO visitas VALUES('2587', '12', '756', '5', '2008-03-27', 'visite el lugar, le deje dos cuadros Sinfonia y 1 cuadro Saxo, ademas le deje un par de folletos. La idea es arrancar este fin de semana');
INSERT INTO visitas VALUES('2600', '14', '643', '5', '2008-03-31', 'y una botalla de Chardannay a pedido especial del cliente para que lo pruebe la mujer (que le gusta el blanco). La botella de SAXO es un regalo por el cumplea?os de la mujer, para el que nos compraron 2 cajas. Ella me dijo especialmente que le gusta el Champagne...');
INSERT INTO visitas VALUES('2603', '12', '110', '10', '2008-03-31', 'por ahora no estan haciendo incorporaciones, debido a que tienen muchas etiquetas, y los obligaron a parar, asi q le deje la de Saxo 355 que les puede interesar');
INSERT INTO visitas VALUES('2617', '14', '740', '5', '2008-04-07', 'Quiere probar porque suele tomar.');
INSERT INTO visitas VALUES('2618', '14', '703', '5', '2008-04-07', 'Degustaci?n para el gerente de la financiera \"Centurion\" en Palermo Soho.');
INSERT INTO visitas VALUES('2632', '12', '756', '5', '2008-04-11', 'estuve en el local, le deje copas de cata y un chardonnay y un roble para que lo prueben con los clientes.');
