INSERT INTO visitas VALUES('2634', '12', '233', '5', '2008-04-11', 'estuve en Jumbo Unicenter donde ya estan todos los productos, el precio esta correcto en todos, le faltaba el precio al champagne pero hable con el repositor para que lo arregle');
INSERT INTO visitas VALUES('2647', '12', '762', '5', '2008-04-15', 'deje muestras, les encanto la etiqueta de los dos, les parecio un vino que tenia mas imagen de lo que valia, fue muy sincero me dijo que lo iban a probar pero por el momento no estan incorporando productos xq esta bastante parado el negocio');
INSERT INTO visitas VALUES('2654', '12', '761', '5', '2008-04-16', 'entregue muestras me comento que manejan un margen de aprox 35%, van a probar el producto y volvemos a hablar');
INSERT INTO visitas VALUES('2655', '12', '765', '5', '2008-04-16', 'deje muestras a Florencia asistente de compras van a probar el producto quedamos en que los vuelvo a llamar, les deje catalogo');
INSERT INTO visitas VALUES('2694', '12', '772', '5', '2008-04-29', 'deje una de chardonnay para casamiento, nos contacto la empresa de catering, vamos a ver q le parece al cliente');
INSERT INTO visitas VALUES('2699', '14', '703', '5', '2008-04-30', 'Degustaci?n para posible fiesta de cumplea?os.');
