INSERT INTO visitas VALUES('2737', '12', '233', '5', '2008-05-16', 'me junte con Enzo le pague y estuvimos viendo un poco como se movio este mes, y como viene el mes proximo, ,le mostre los nuevos productos y le conte sobre las degustaciones');
INSERT INTO visitas VALUES('2741', '12', '757', '5', '2008-05-16', 'pase hoy, para ver la barra le agregaron mas luz y burbujas,todavia falta separar los bordes, hicimos remeras para todos los empleados ');
INSERT INTO visitas VALUES('2742', '12', '233', '5', '2008-05-16', 'estuve en Jumbo Unicenter, estaban todos los productos, quedaba muy poco del roble, ya se emitio una nueva orden, hable con el somellier que es nuevo ahi, quede en mandarle una botella a la casa para que lo pruebe');
