INSERT INTO visitas VALUES('2831', '12', '786', '5', '2008-06-13', 'Es un amigo de Charly que le interesa vender el champagne porque le gusto. Se llevo lista de precios, tarjetas y producto para llevar a restaurantes en toda la zona de Ca?itas en dos semanas nos juntamos con su informe.');
