INSERT INTO visitas VALUES('3451', '12', '846', '5', '2009-08-07', 'Hicimos una degustacion el dia de la inaguracion, pusimos el banner y copas');
INSERT INTO visitas VALUES('3497', '2', '55', '4', '2009-09-15', 'Se dejo un caja con diferentes productos para degustar para el casamiento 3 Sinfon?as SV Malbec / Cabernet Sauvignon / chardonnay 1 Sinfon?a Roble / 1 Sinfonia Reserva 1 Saxo Celebration / 2 Saxo 355');
INSERT INTO visitas VALUES('3498', '2', '852', '4', '2009-09-08', 'Fui con Esteban Vivo y nos recibi? Claudio Sartan (Gerente General. Le dejamos muestra de 2 Sinfon?a SV (Malbec y Cabernet Sauvignon), 1 sinfon?a Roble Malbec y 2 Saxo 355 ml. No le funciona la marca propia, si probablemente una marca exclusiva. Van a estudiar junto con su equipo comercial, que ser?a conveniente y a que rango de precio. Adicionalmente, estaban largando un programa de cable cerrado sobre Distribuci?n, donde est?n invitando a mucha gente de la industria. Llamarlo en dos semanas.');
INSERT INTO visitas VALUES('3499', '2', '851', '4', '2009-09-02', 'Visite con Sandra Pereira, la gente de Codere en el Bingo de San Justo. Habiamos quedado en econtrarnos con Ruben Oviedo (coordinador gastron?mico de CODERE) pero nos desencotramos y nos atendi? el gerente del local (Arturo?). Le dejamos las muestras (2 vinos sinfon?a SV, 1 vino Sinfon?a Roble y un pack de SAxo 355 ml) para que lo degusten. El vino que mas sale es el Vasco Viejo, el cual casi pueden vender aprox. unas 40 cajas por semana. El resto menos, y el champagne menos tambi?n. Le iba a pasar las muestras a Ruben. Llamarlo en dos semanas.');
INSERT INTO visitas VALUES('3519', '18', '855', NULL, '2009-09-19', 'Habl? con Sergio. En general se manejan con primeras marcas; cada vez que vende puntualmente otra, la vende solo durante la acci?n puntual pero luego la gente le vuelve a consumir lo tradicional.');
INSERT INTO visitas VALUES('3520', '18', '856', NULL, '2009-09-19', 'La visite dos veces; le deje a Diego muestras de vino Sinfoni. Sugiere modificaci?n de lista, 2 columnas con el precio sugerido al p?blico y el precio con los descuentos que le hacemos');
INSERT INTO visitas VALUES('3521', '18', '858', NULL, '2009-09-19', 'Estuve con Diego, prob? el Saxo me va hacer el pedido la semana que viene.');
INSERT INTO visitas VALUES('3522', '18', '757', NULL, '2009-09-19', 'Pago la deuda pendiente. Vale necesito el telefono de Agustin que es el chico de Nemo en Kite Beach, pero Miguel me coment? que no lo hace mas ah? y que se mudaron.');
INSERT INTO visitas VALUES('3523', '18', '114', NULL, '2009-09-19', 'Hable con Martin; trabajan con Nieto Senetiner, Navarro Correas, Lopez y una bodega chica por amistad. Las bodegas le hacen 1x1, Nieto 2x1 y Lopez un descuento. Tienen un catering, pero ah? ya consigue buenos precios con las bodegas. Va a estudiar la posibilidad de incluirnos en el men? cerrado, como copa. ');
