INSERT INTO visitas VALUES('3570', '19', '969', NULL, '2010-06-25', 'Visita de rutina para conocer el lugar. Es un club de vino, con socios de alto poder adquisitivo, ubicado en un zona privilegiada de Rosario. Tenemos como propuesta que en los meses siguientes ofrezcan nuestro Roble o Reserva para la degustacion de los socios.');
INSERT INTO visitas VALUES('3571', '19', '970', NULL, '2010-06-25', 'Visita a la vinoteca. Es una vinoteca que tiene el Sinfonia expuesto en la vidriera. Lo vende mucho, a la gente de la zona le gusto mucho el vino. Tiene las cajas apiladas y presentadas en el centro del local.');
