INSERT INTO visitas VALUES('3580', '21', '1129', NULL, '2012-04-26', 'El 26 de abril de 2012 10:59, Verónica Caspani (Club del Vino) <vcaspani@clubdelvino.com.ar> escribió:\r\nHola Fernando,\r\n \r\nLamentablemente con este vino no podremos seguir adelante, te paso  la comunicación de la sommelier:\r\nSe cato el vino y esta correcto pero no va con el estilo de vinos que ponemos en la sección Avant Premier,  ya que buscamos vinos bien frutados donde la madera sea sutil y con buen cuerpo.\r\n \r\nSi mal no recuerdo, me habías comentado que tenias vinos para Premium ( entre los 100 y 200 pesos la botella) si queres envíanos muestras de ellos.\r\n \r\nMuchas gracias!\r\n \r\nSaludos,\r\n \r\nVerónica Caspani\r\nClub del  Vino S.A.\r\nFlorida 826 1° Piso - (1005) CABA\r\nvcaspani@clubdelvino.com.ar\r\nTel.: (011) 5273 8320\r\nFax.: (011) 4511 8191');
